import Card from "./UI/Card";
import Button from "react-bootstrap/Button";

const DifficultySelector = (props) => {
  return (
    <Card>
      <Button variant='primary' size='lg'>Easy</Button>
    </Card>
  );
};

export default DifficultySelector;
